resources.string:
Ohjeet:
--------------
-Napauta "Varmuuskopioi" -painiketta;
-Ota datasiirto käyttöön Wi-Fi:n tai mobiiliverkon kautta ja salli sovellukselle kaikki yhteydet;
-Valitse malli ja napauta "Paikkaa";
-napauta "Käynnistä" ja tarkista käyttöluvan tila (päivitä jos tarpeen);
-Jos tämä malli ei auta, napauta "Palauta" ja yritä uudelleen toisella mallilla.
 Jos toimenpide onnistui, napauta Tee muutokset.

Ohje:

 - Malli alkuperäiselle hex:lle (pituus>3):
 AA 1F ** 01 4C
 ** - mikä tahansa tavu;

 - Malli korvaavalle hex:lle (pituus>3):
 EA 2F ** ** **
 ** - ei vaihda tavua;

Alkuperäisten ja muokattujen tavujen määrä pitää olla sama;
